import "./topbar.scss";
import { Person, mail } from "@material-ui/icons";

export default function Topbar() {
  return (
    <div className="topbar">
      <div className="wrapper">
        <div className="left">
          <a href="#intro" className='logo'>genius.</a>
          <div className="itemContainer">
              <Person />
              <span>+44 992 00</span>
          </div>
        </div>
        <div className="right">
        </div>
      </div>
    </div>
  );
}
